// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./RLUSDStablecoin.sol";

/**
 * @title DataMarketplace
 * @dev Manages data queries, reward distribution using RLUSD, and a basic reputation system.
 */
contract DataMarketplace {

    RLUSDStablecoin public rlusd;
    address public owner;
    uint256 public dataQueryPrice;

    // Reputation mapping
    mapping(address => uint256) private reputation;

    // Events
    event QueryPurchased(address indexed buyer, uint256 price);
    event RewardsDistributed(address indexed provider, uint256 amount);
    event ReputationUpdated(address indexed user, uint256 newScore);
    event DataQueryPriceUpdated(uint256 newPrice);

    modifier onlyOwner() {
        require(msg.sender == owner, "DataMarketplace: Not contract owner");
        _;
    }

    constructor(address _rlusdToken, uint256 _initialQueryPrice) {
        rlusd = RLUSDStablecoin(_rlusdToken);
        dataQueryPrice = _initialQueryPrice;
        owner = msg.sender;
    }

    /**
     * @dev Update the cost of a data query in RLUSD. Only owner can set this.
     */
    function setDataQueryPrice(uint256 _newPrice) external onlyOwner {
        dataQueryPrice = _newPrice;
        emit DataQueryPriceUpdated(_newPrice);
    }

    /**
     * @dev Allows a researcher to purchase data access by paying RLUSD to this contract.
     */
    function purchaseDataAccess() external {
        require(
            rlusd.transferFrom(msg.sender, address(this), dataQueryPrice),
            "DataMarketplace: RLUSD transfer failed"
        );
        emit QueryPurchased(msg.sender, dataQueryPrice);

        // Off-chain aggregator will listen to this event, handle queries/federated learning, etc.
    }

    /**
     * @dev Distributes RLUSD rewards to data providers after successful federated learning or data usage.
     * Only the owner (or aggregator) can call this.
     */
    function distributeRewards(address _provider, uint256 _amount) external onlyOwner {
        // Transfer RLUSD out from contract to the provider
        bool success = rlusd.transfer(_provider, _amount);
        require(success, "DataMarketplace: RLUSD transfer failed");
        emit RewardsDistributed(_provider, _amount);
    }

    /**
     * @dev Updates a user's reputation score. Only owner can call this.
     */
    function updateReputation(address _user, uint256 _newScore) external onlyOwner {
        reputation[_user] = _newScore;
        emit ReputationUpdated(_user, _newScore);
    }

    /**
     * @dev Retrieves the reputation score of a user.
     */
    function getReputation(address _user) external view returns (uint256) {
        return reputation[_user];
    }
}

contracts/privacyManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./zkProofVerifier.sol";

/**
 * @title PrivacyManager
 * @dev Manages user registration, ZK-proof verification, and consent for data sharing
 */
contract PrivacyManager {
    ZkProofVerifier public verifier;

    // constructor(address _zkProofVerifier) {
    //     verifier = ZkProofVerifier(_zkProofVerifier);
    // }

    struct UserInfo {
        bool exists;
        bool consent;
        string dataURI;    // IPFS/Filecoin URI (CID)
        bytes32 dataHash;  // Hash of encrypted data
    }

    mapping(address => UserInfo) private users;

    event UserRegistered(address indexed user);
    event ConsentUpdated(address indexed user, bool consent, string dataURI, bytes32 dataHash);

    constructor(address _zkProofVerifier) {
        verifier = ZkProofVerifier(_zkProofVerifier);
    }

    modifier onlyRegistered() {
        require(users[msg.sender].exists, "PrivacyManager: User not registered");
        _;
    }

    /**
     * @dev Registers a new user via a zero-knowledge proof.
     * @param _proof The Groth16 proof struct (A, B, C).
     * @param _publicSignals The array of public signals needed for verification.
     */
    function registerUser(
        ZkProofVerifier.Proof memory _proof, 
        uint256[] memory _publicSignals
    ) external {
        require(!users[msg.sender].exists, "PrivacyManager: Already registered");

        // Verify the user's ZK proof
        bool proofValid = verifier.verifyProof(_proof, _publicSignals);
        require(proofValid, "PrivacyManager: Invalid ZK proof");

        users[msg.sender] = UserInfo({
            exists: true,
            consent: false,
            dataURI: "",
            dataHash: 0
        });

        emit UserRegistered(msg.sender);
    }

    /**
     * @dev Allows a registered user to update their consent and data references.
     * @param _consent True/False for consenting to share data
     * @param _dataURI IPFS/Filecoin CID with encrypted data
     * @param _dataHash A keccak256 or SHA256 hash of the encrypted data
     */
    function setConsent(
        bool _consent, 
        string calldata _dataURI, 
        bytes32 _dataHash
    ) external onlyRegistered {
        users[msg.sender].consent = _consent;
        users[msg.sender].dataURI = _dataURI;
        users[msg.sender].dataHash = _dataHash;

        emit ConsentUpdated(msg.sender, _consent, _dataURI, _dataHash);
    }

    /**
     * @dev Retrieve the user info for an address. (In production, consider access controls here!)
     */
    function getUserInfo(address _user) 
        external 
        view 
        returns (bool exists, bool consent, string memory dataURI, bytes32 dataHash) 
    {
        UserInfo memory info = users[_user];
        return (info.exists, info.consent, info.dataURI, info.dataHash);
    }

    /**
     * @dev Checks whether an address is registered.
     */
    function isRegistered(address _user) external view returns (bool) {
        return users[_user].exists;
    }
}

contracts/RLUSDStablecoin.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title RLUSDStablecoin
 * @dev A standard ERC-20 stablecoin representing USD on the XRPL EVM sidechain.
 */
contract RLUSDStablecoin {
    // ERC-20 basic info
    string public name = "RLUSD Stablecoin";
    string public symbol = "RLUSD";
    uint8 public decimals = 18;

    uint256 private _totalSupply;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    // Events
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(uint256 initialSupply) {
        _mint(msg.sender, initialSupply * 10**decimals);
    }

    // -----------------------
    //       ERC-20
    // -----------------------

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }


    function transfer(address recipient, uint256 amount) public returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender, 
        address recipient, 
        uint256 amount
    ) public returns (bool) {
        _transfer(sender, recipient, amount);
        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(currentAllowance >= amount, "RLUSD: transfer amount exceeds allowance");
        _approve(sender, msg.sender, currentAllowance - amount);
        return true;
    }

    // -----------------------
    //   INTERNAL FUNCTIONS
    // -----------------------

    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "RLUSD: transfer from the zero address");
        require(recipient != address(0), "RLUSD: transfer to the zero address");
        require(_balances[sender] >= amount, "RLUSD: transfer amount exceeds balance");

        _balances[sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(sender, recipient, amount);
    }

    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "RLUSD: mint to the zero address");
        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }

    function _approve(
        address owner, 
        address spender, 
        uint256 amount
    ) internal {
        require(owner != address(0), "RLUSD: approve from the zero address");
        require(spender != address(0), "RLUSD: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}

